css:
.editor-colors {
  background-color: #2b303b;
  color: #a7adba;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #4f5b66;
}
.editor .gutter {
  background-color: #343d46;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #ab7967;
}
.editor .cursor {
  border-color: #eff1f5;
}
.editor .selection .region {
  background-color: #343d46;
  color: #2b303b;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #4f5b66;
}
.editor .wrap-guide {
  background-color: #343d46;
}
.bracket-matcher {
  background-color: #c0c5ce;
  opacity: 0.5;
}
.comment {
  color: #4f5b66;
}
.entity {
  color: #d08770;
}
.keyword {
  color: #b48ead;
}
.storage.type {
  color: #b48ead;
}
.constant {
  color: #ebcb8b;
}
.constant.numeric,
.constant.boolean {
  color: #d08770;
}
.variable {
  color: #8fa1b3;
}
.delimiter,
.brace {
  color: #a7adba;
}
.delimiter.period {
  color: #a3be8c;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #bf616a;
}
.invalid.illegal {
  color: #bf616a;
}
.string {
  color: #a3be8c;
}
.string .constant.character.escape {
  color: #a7adba;
}
.string.regexp {
  color: #96b5b4;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #bf616a;
}
